import React, { Component } from "react";
import Announcements from "./announcements";
import Events from "./upcomingEvents";
import "./footer.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { SocialIcon } from "react-social-icons";
import axios from "axios";

export default class Footer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      archives: [],
      courseImages: [],
    };
  }

  async componentDidMount() {
    const { data: courseImages } = await axios.get(
      "http://127.0.0.1:8000/courseImages/"
    );
    const { data: archives } = await axios.get(
      "http://127.0.0.1:8000/archives/"
    );
    // console.log(archives);
    this.setState({ courseImages, archives });
    // console.log(courseImages);
  }

  render() {
    // console.log(this.state.archives);
    // console.log(this.state.courseImages);
    return (
      <div class="container-fluid">
        <div
          className="row display: flex primaryBackground footerMainDiv"
          style={{ backgroundColor: "#002f5f" }}
        >
          <div className="col-md-4 aligncontent pad">
            <strong style={{ color: "#f7941d" }}>Contact Us</strong>
            <br />
            <p className="fontsize inlineDisplay">
              <svg
                width="1em"
                height="1em"
                viewBox="0 0 16 16"
                class="bi bi-telephone"
                fill="#f7cd00"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  fill-rule="evenodd"
                  d="M3.925 1.745a.636.636 0 0 0-.951-.059l-.97.97c-.453.453-.62 1.095-.421 1.658A16.47 16.47 0 0 0 5.49 10.51a16.471 16.471 0 0 0 6.196 3.907c.563.198 1.205.032 1.658-.421l.97-.97a.636.636 0 0 0-.06-.951l-2.162-1.682a.636.636 0 0 0-.544-.115l-2.052.513a1.636 1.636 0 0 1-1.554-.43L5.64 8.058a1.636 1.636 0 0 1-.43-1.554l.513-2.052a.636.636 0 0 0-.115-.544L3.925 1.745zM2.267.98a1.636 1.636 0 0 1 2.448.153l1.681 2.162c.309.396.418.913.296 1.4l-.513 2.053a.636.636 0 0 0 .167.604L8.65 9.654a.636.636 0 0 0 .604.167l2.052-.513a1.636 1.636 0 0 1 1.401.296l2.162 1.681c.777.604.849 1.753.153 2.448l-.97.97c-.693.693-1.73.998-2.697.658a17.47 17.47 0 0 1-6.571-4.144A17.47 17.47 0 0 1 .639 4.646c-.34-.967-.035-2.004.658-2.698l.97-.969z"
                />
              </svg>
              <span> Pakistan : +92 334 1145908</span>
              <br />
              <span>Kuwait : +965 65106756, +965 99614518</span>
              <span></span>
              <span></span>
              <span></span>
              <span></span>
            </p>
            <p className="fontsize">admin@hsecertintl.com</p>

            <p className="fontsize">
              HseCertIntl, Klass wala road, Pasrur dist. Sialkot, Pakistan
            </p>

            <p className="fontsize">HseCertIntl, Mahboula, Ahmadi Kuwait</p>
          </div>

          <div className="col-md-4 aligncontent pad">
            <strong style={{ color: "#f7941d" }}>Connect with us</strong>

            <br />
            <SocialIcon
              network="twitter"
              url="https://www.twitter.com"
              fgColor="white"
              bgColor="#002f5f"
              className="s_icons"
            />
            <SocialIcon
              network="facebook"
              url="https://www.facebook.com"
              fgColor="white"
              bgColor="#002f5f"
              className="s_icons"
            />
            <SocialIcon
              network="linkedin"
              url="https://www.linkedin.com"
              fgColor="white"
              bgColor="#002f5f"
              className="s_icons"
            />

            <SocialIcon
              network="instagram"
              url="https://www.instagram.com"
              fgColor="white"
              bgColor="#002f5f"
              className="s_icons"
            />
          </div>
          <div className="col-md-4 aligncontent pad">
            <strong style={{ color: "#f7941d" }}>Quick Links</strong>

            <br />
            <a href="/archives" className="footerLink fontsize">
              Archives
            </a>
            <br />
            <a href="/imageGallery" className="footerLink fontsize">
              Photo Gallery
            </a>
            <br />
            <a href="/" className="footerLink fontsize">
              Help Center(FAQ)
            </a>
            <br />

            <br />
          </div>
        </div>
      </div>
    );
  }
}
